const wchar_t *t3_to_lower(wchar_t ch)
{
    case_table *e = case_tab[ch >> 7];
    if (e == 0)
        return 0;
    int ofs = e[ch & 127].lower;
    return ofs == 0 ? 0 : &case_expansion[ofs];
}

